import React from "react";
import Layout from '../src/components/Layout'
// import Link from "next/link"


function Main({...props}) {
    return (
        <>
            <Layout />
        </>
    );
}

export async function getServerSideProps(context) {
    
   return {
        props:{title:"This is server prop"}
   }
}
export default Main;
